jQuery(document).ready(function(e){wp.media.view.Settings.Gallery=wp.media.view.Settings.Gallery.extend({template:function(t){templates=wp.media.template("custom-gallery-legacy")(t);if(e("#tmpl-custom-gallery-setting").html()){templates=wp.media.template("custom-gallery-setting")(t)+templates}return wp.media.template("gallery-settings")(t)+templates}})})